import React from "react";

export default class UserPage extends React.Component {
  state = {
    data: null,
  };

  componentDidMount() {
    let token = "Bearer ";
    if (JSON.parse(localStorage.getItem("login")).data != null) {
      token.concat(JSON.parse(localStorage.getItem("login")).data);
    }
    console.log(token);
    fetch("http://localhost:8080/user-page", {
      method: "get",
      headers: {
        Accept: "application/json, text/plain",
        "Content-Type": "application/json;charset=UTF-8",
        Authorization: token,
      },
    })
      .then((res) => {
        res.json().then((res) => {
          console.log("result:", res);
          this.setState({
            data: res,
          });
        });
      })
      .catch((error) => console.log("Error detected: " + error));
  }

  render() {
    return (
      <div>
        User page
        <div>
          Data: {this.state.data ? this.state.data : <div>nothing</div>}
        </div>
      </div>
    );
  }
}
